import List from '@mui/material/List';
import ListItem from '@mui/material/ListItem';
import ListItemButton from '@mui/material/ListItemButton';
import ListItemIcon from '@mui/material/ListItemIcon';
import ListItemText from '@mui/material/ListItemText';
import { Link } from "react-router-dom";

 function Menu() {
  return (
    <List
      sx={{ width: '100%', maxWidth: 360, bgcolor: '#061e6e', color:'white' }}
      aria-label="contacts"
    >
      <ListItem disablePadding>
        <ListItemButton>
          <ListItemIcon>
          </ListItemIcon>
          <ListItemText primary="Modelos" />
        </ListItemButton>
      </ListItem>
      <ListItem disablePadding>
        <Link to="/assets">
        <ListItemButton >
          <ListItemText inset primary="Unidades" />
        </ListItemButton>
        </Link>

      </ListItem>
      <ListItem disablePadding>
        <ListItemButton>
          <ListItemText inset primary="Gráficos" />
        </ListItemButton>
      </ListItem>
      <ListItem disablePadding>
        <ListItemButton>
          <ListItemText inset primary="Usuários" />
        </ListItemButton>
      </ListItem>
    </List>
  );
}

export default Menu;
